import React, { Component } from 'react';
import './App.css';
import ToDoListItem from "./ToDoListItem.js"

class App extends Component {
  render() {
    return (
      <div className="App">
        <div>
          <ToDoListItem
            title="ホームページ作成"
            discription="サークルホームページを今週中に作成する"
          />
        </div>
      </div>
    );
  }
}

export default App;
